import React from "react";
import "./style.css";
function Card(props) {
  return <div>
    <h1 className=""></h1>
  </div>;
}
function App() {
  return (
    <div>
      <h1 className="heading">Personagens</h1>
      <div className="card">
        <div className="top">
          <h2 className="name">Satoro Gojo</h2>
          <img
            className="circle-img"
            src="https://dimensaosete.com.br/static/7fc311549694666167a49cdb0fb1293c/2493a/gojo.webp"
            alt=""
          />
        </div>
        <div className="bottom">
          <p className="info">Você é fraco</p>
        </div>
      </div>
    </div>
  );
}

export default App;
